import Entertainment from '../../assets/pictures/Entertainment.png'
export function QuestionIcon({
   category,
   className,
}: {
   category: string
   className?: string
}) {
   if (category?.includes('Sports')) return <Sports className={className} />
   if (category?.includes('Geography'))
      return <Geography className={className} />
   if (category?.includes('Science')) return <Science className={className} />
   if (category?.includes('History')) return <History className={className} />
   if (category?.includes('Art')) return <Art className={className} />
   if (category?.includes('Entertainment'))
      return (
         <img
            src={Entertainment}
            title='Entertainment'
            width='120px'
            className={className}
         ></img>
      )
   return <GeneralKnowledge className={className} />
}
